import React from 'react';
import axios from 'axios';
const SelectedTrains = ({ selectedTrains, handleRemoveClick }) => {
  return (
    <div>
      <h1>Selected Trains</h1>
      <div className="selected-items">
        {selectedTrains.map((train) => (
          <div key={train.uniqueId} className="card">
            <h2>{train.title}</h2>
            <p>{train.addr1}</p>
            <img
              src={train.firstimage2 || 'https://via.placeholder.com/300x200?text=No+Image'}
              alt={train.title}
              className="selected-image"
            />
            <button onClick={() => handleRemoveClick(train.contentid)}>삭제</button>
          </div>
        ))}
